import "./Model1.css";
import Card from "../UI/Card";

const Model2 = (props) => {
  console.log("hola");
  return (
    <Card>
      <div className="modal">
        {/* <!-- Modal content --> */}
        <div className="modal-content">
          <span className="close">&times;</span>
          <p>Some text in the Modal2..</p>
        </div>
      </div>
    </Card>
  );
};
export default Model2;
